import React, { useState } from 'react';
import Accordion from 'react-bootstrap/Accordion';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';

const Services = () => {

    const [checkedAll, setCheckedAll] = useState(false);

    const [typeServiceF, settypeServiceF] = useState(false);

    const handletypeServiceFChange = (e) => {
        //settypeServiceF(!typeServiceF)
        settypeServiceF(e.target.value);
    };

    const [priceF, setPriceF] = useState(false);

    const handlepriceFChange = (e) => {
        //setPriceF(!priceF)
        setPriceF(e.target.value);
    };

    const [timeF, settimeF] = useState(false);

    const handletimeFChange = (e) => {
        //settimeF(!timeF)
        settimeF(e.target.value);
    };

    const data = 
    [
        { type: 'Body Treatment', price: 175, time: 75},
        { type: 'Body Treatment', price: 130, time: 60},
        { type: 'Body Treatment', price: 100, time: 50},
        { type: 'Facial Treatment', price: 175, time: 60},
        { type: 'Facial Treatment', price: 130, time: 75},
        { type: 'Facial Treatment', price: 100, time: 40},
        { type: 'Esthetic', price: 175, time: 75},
        { type: 'Esthetic', price: 130, time: 75},
        { type: 'Esthetic', price: 100, time: 60}
    ];

    const filteredData = data.filter((item) => {
        if (typeServiceF && item.type !== typeServiceF) {
          return false;
        }
        if (priceF && item.price !== parseInt(priceF)) {
          return false;
        }
        if (timeF && item.time !== parseInt(timeF)) {
          return false;
        }
        return true;
    });

    return (
        <div>
            <h1 className='titlePages'>Services</h1>
                <div>
                    <Container>
                        <Row>
                            <Col>
                                <div>
                                    <Accordion className='accord' defaultActiveKey="0">
                                        <Accordion.Item eventKey="0">
                                            <Accordion.Header>Type of Service</Accordion.Header>
                                            <Accordion.Body>
                                                <div>
                                                    <input type="checkbox" value="Body Treatment" name='Body Treatment' onChange={handletypeServiceFChange}
                                                    />
                                                    <label>Body Treatment</label>
                                                </div>

                                                <div>
                                                    <input type="checkbox" value="Facial Treatment" name='Facial Treatment' onChange={handletypeServiceFChange}
                                                    />
                                                    <label>Facial Treatment</label>
                                                </div>

                                                <div>
                                                    <input type="checkbox" value="Esthetic" name='Esthetic' onChange={handletypeServiceFChange}
                                                    />
                                                    <label>Esthetic</label>
                                                </div>

                                            </Accordion.Body>
                                        </Accordion.Item>
                                        <Accordion.Item eventKey="1">
                                            <Accordion.Header>Price</Accordion.Header>
                                            <Accordion.Body value={priceF} onChange={handlepriceFChange}>
                                                <div>
                                                    <input type="checkbox" value="175" name='175' onChange={handlepriceFChange}
                                                    />
                                                    <label>175$</label>
                                                </div>

                                                <div>
                                                    <input type="checkbox" value="130" name='130' onChange={handlepriceFChange}
                                                    />
                                                    <label>130$</label>
                                                </div>

                                                <div>
                                                    <input type="checkbox" value="100" name='100' onChange={handlepriceFChange}
                                                    />
                                                    <label>100$</label>
                                                </div>
                                            </Accordion.Body>
                                        </Accordion.Item>
                                        <Accordion.Item eventKey="2">
                                            <Accordion.Header>Time</Accordion.Header>
                                            <Accordion.Body value={timeF} onChange={handletimeFChange}>
                                                <div>
                                                    <input type="checkbox" value="40" name='40' checked={timeF.includes('40')} onChange={handletimeFChange}
                                                    />
                                                    <label>40 minutes</label>
                                                </div>

                                                <div>
                                                    <input type="checkbox" value="50" name='50' checked={timeF.includes('50')}onChange={handletimeFChange}
                                                    />
                                                    <label>50 minutes</label>
                                                </div>

                                                <div>
                                                    <input type="checkbox" value="60" name='60' checked={timeF.includes('60')} onChange={handletimeFChange}
                                                    />
                                                    <label>60 minutes</label>
                                                </div>
                                                <div>
                                                    <input type="checkbox" value="75" name='75' checked={timeF.includes('75')} onChange={handletimeFChange}
                                                    />
                                                    <label>75 minutes</label>
                                                </div>
                                            </Accordion.Body>
                                        </Accordion.Item>
                                    </Accordion>
                                </div>
                            </Col>
                        </Row>
                    </Container>
                </div>

                <div>
                    <h3>Filtered Results:</h3>
                    <ul>
                        {filteredData.map((item, index) => (
                        <ul key={index}>
                            <div>
                                Type of Service: {item.type}
                            </div>
                            <div>
                                Price: {item.price}
                            </div>
                            <div>
                                Time: {item.time}
                            </div>
                        </ul>
                        ))}
                    </ul>
                </div>
            </div>
      );

}
export default Services;
